var assert=require("assert");var util=require("../../");suite("inspect");test("util.inspect - test for sparse array",function(){var b=["foo","bar","baz"];assert.equal(util.inspect(b),"[ 'foo', 'bar', 'baz' ]");delete b[1];assert.equal(util.inspect(b),"[ 'foo', , 'baz' ]");assert.equal(util.inspect(b,true),"[ 'foo', , 'baz', [length]: 3 ]");assert.equal(util.inspect(new Array(5)),"[ , , , ,  ]")});test("util.inspect -  exceptions should print the error message, not '{}'",function(){assert.equal(util.inspect(new Error()),"[Error]");assert.equal(util.inspect(new Error("FAIL")),"[Error: FAIL]");assert.equal(util.inspect(new TypeError("FAIL")),"[TypeError: FAIL]");assert.equal(util.inspect(new SyntaxError("FAIL")),"[SyntaxError: FAIL]")});